import React, { useState, useEffect } from 'react';
import axios from 'axios';

function GovernmentDashboard() {
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [filters, setFilters] = useState({
    schoolName: '',
    schoolArea: '',
    schoolDistrict: '',
  });

  useEffect(() => {
    // Fetch data from your backend API and update the state
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:3002/api/getStudentData'); // Update the API endpoint URL
      setData(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  const applyFilters = () => {
    // Apply filters to the data
    const filtered = data.filter((item) => {
      return (
        item.schoolName.includes(filters.schoolName) &&
        item.schoolArea.includes(filters.schoolArea) &&
        item.schoolDistrict.includes(filters.schoolDistrict)
      );
    });

    setFilteredData(filtered);
  };

  return (
    <div>
      <h2>Government Dashboard</h2>
      <div className="filter-inputs">
        <input
          type="text"
          name="schoolName"
          placeholder="Filter by School Name"
          value={filters.schoolName}
          onChange={handleFilterChange}
        />
        <input
          type="text"
          name="schoolArea"
          placeholder="Filter by School Area"
          value={filters.schoolArea}
          onChange={handleFilterChange}
        />
        <input
          type="text"
          name="schoolDistrict"
          placeholder="Filter by School District"
          value={filters.schoolDistrict}
          onChange={handleFilterChange}
        />
        <button onClick={applyFilters}>Apply Filters</button>
      </div>
      <table>
        <thead>
          <tr>
            <th>School Name</th>
            <th>Student Name</th>
            <th>Student Class</th>
            <th>Dropout Reason</th>
            <th>Age</th>
            <th>Caste</th>
            <th>School Area</th>
            <th>School District</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.length > 0
            ? filteredData.map((item) => (
                <tr key={item._id}>
                  <td>{item.schoolName}</td>
                  <td>{item.studentName}</td>
                  <td>{item.studentClass}</td>
                  <td>{item.dropoutReason}</td>
                  <td>{item.age}</td>
                  <td>{item.caste}</td>
                  <td>{item.schoolArea}</td>
                  <td>{item.schoolDistrict}</td>
                </tr>
              ))
            : data.map((item) => (
                <tr key={item._id}>
                  <td>{item.schoolName}</td>
                  <td>{item.studentName}</td>
                  <td>{item.studentClass}</td>
                  <td>{item.dropoutReason}</td>
                  <td>{item.age}</td>
                  <td>{item.caste}</td>
                  <td>{item.schoolArea}</td>
                  <td>{item.schoolDistrict}</td>
                </tr>
              ))}
        </tbody>
      </table>
    </div>
  );
}

export default GovernmentDashboard;
